postcontent:
This gun has less than 50 rounds through it, and is in excellent condition with many upgrades.
1. It comes with professionally installed XS Big Dot tritium night sights (perfect for a gun of this type, and far better than the stock sights);
2. It comes with 4 magazines instead of just one when purchased new. The 4 mags consist of three (3) 6-round OEM magazines and one OEM mag with 7-round MagGuts internals (follower and springs)(the MagGuts magazine is hard to see because it's standing up straight in the middle);
3. There are three (3) extra magazine floor plates (2 extended, 1 flush);
4. Talon Grips in flawless condition are also installed (the rubber variety aid in giving you a better purchase on the gun);
5. and it comes with the original box and packaging (including the S&W carrying case).
Lastly, you have a choice between the LEFT-handed Alabama Holster Company kydex pocket holster in the picture, OR, a box of Fiocchi XTP hollowpoint 380 ammo (highly rated: https://www.youtube.com/watch?v=GNtPHYwcDts).
$300, firm; and cash only please (I am not interested in trading this time around unless you happen to have a Glock 33 or 27 Gen4). You must also be a resident of Ohio who is legally allowed to purchase firearms, and you must be willing to come to the Columbus area.
